function Navbar() {
  return (
    <nav style={{
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "1rem 2rem",
      borderBottom: "1px solid #333"
    }}>
      <div style={{ fontSize: "1.2rem" }}>Carol Li Zhang</div>
      <div>
        <a href="/projects" style={{ marginLeft: "2rem", textDecoration: "none", color: "black" }}>
          Projects
        </a>
        <a href="/about" style={{ marginLeft: "2rem", textDecoration: "none", color: "black" }}>
          About
        </a>
      </div>
    </nav>
  );
}
